tables.table_schema:
CREATE TABLE HospitalPerformance (
    hospital_id INT PRIMARY KEY,
    performance_rating FLOAT,
    outcome_score FLOAT,
    resource_utilization FLOAT
);

CREATE TABLE PatientOutcomes (
    patient_id INT PRIMARY KEY,
    admission_date DATE,
    discharge_date DATE,
    mortality_status BOOLEAN
);

CREATE TABLE hospital_performance (
    hospital_id INT,
    performance_metric TEXT,
    performance_score FLOAT
);

CREATE TABLE patient_outcomes (
    patient_id INT,
    outcome_type TEXT,
    outcome_score FLOAT
);

CREATE TABLE resource_utilization (
    resource_id INT,
    resource_type TEXT,
    resource_amount INT
);

CREATE TABLE Hospital (
	hospital_id UUID PRIMARY KEY,
	hospital_name VARCHAR,
	hospital_location VARCHAR
);

CREATE TABLE Patient (
	patient_id UUID PRIMARY KEY,
	patient_name VARCHAR,
	patient_age INT,
	patient_gender VARCHAR
);

CREATE TABLE Report (
	report_id UUID PRIMARY KEY,
	patient_id UUID,
	hospital_id UUID,
	report_date DATE
);

CREATE TABLE Performance (
	performance_id UUID PRIMARY KEY,
	hospital_id UUID,
	efficiency_score FLOAT,
	quality_score FLOAT
);

CREATE TABLE ResourceUtilization (
	resource_id UUID PRIMARY KEY,
	hospital_id UUID,
	resource_type VARCHAR,
	resource_quantity INT
);
